import React from 'react';
import { Box, Button, Input } from '@mui/joy'

const TodoAdd = () => {
    return (
        <Box>
            <Input
            sx={{width: '100%', marginRight: '5px'}}
             placeholder='New todo...' />
            <Button>Add</Button>
        </Box>
    );
};

export default TodoAdd;
